/*
---------------------------------------- Abilities Mod ----------------------------------------

Dueling, but ships have special abilities. 

Gem storage has been revamped, giving ships a second invisible gem storage that can refill 
the built in one. This allows ships to carry significantly more gems but makes it impossible 
to know how many gems an opponent has (idk how to fix). A ship can only carry 1000 effective 
gems at once so taking too much damage in a single hit will cause you to die even if the 
custom gem bar looks full. A second smaller gem bar on the bottom of the large one will show 
how many effective gems your ship has. This new change also allows ships to pick up gems when 
full, making it easier to prevent opponents from picking up dropped gems. 

Ship power can also be redirected to engines, weapons or shields to increace their performance 
at the expense of the other stats. Movement abilities like a dash and charge can help chase 
down targets or flee. Special attacks like a pulse of lasers, a piercing beam and a swarm of 
missiles have also been added as well as an overdrive skill that greatly increases the stats 
of your ship while consuming gems. An gem restock ability has also been added, which prevents 
your ship falling below 1000 crystals for a short duration (invulnerability). 

The default hotkeys for abilities are centred around the WASD keys but if that is not to your 
preference, you can press "P" to toggle hotkeys to a number based system. Pressing "B" will
instantly refill your shield, generator and gem storage once, I recommend you use it at the 
beginning of a game.

If you have any suggestions or recommendations, create an issue on the github repo. This
mod has not been tested too extensively by 'good' players so some features might be unbalanced.


This mod is based off and inspired by Destroy the Mothership by 45rfew and Absolute Kun. 
A lot of the code and abilities are coppied from there.

-----------------------------------------------------------------------------------------------
*/

