this.tick = function(game){
    modUtils.tick();
    
    if (game.step % 3 === 1){
      for (let ship of game.ships){
          shipshield(ship);
      }
    }
    
    if (game.step % 10 === 0){
      for (let ship of game.ships){
          shipgem(ship);
      }
    }
    
    if (game.step % 10 === 5){
      for (let ship of game.ships){
        ability.tick(ship);
      }
    }
    
    if (game.step % 5 === 2){
        for (let ship of game.ships){
          if (ship.custom.missiles){
              ship.emptyWeapons();
              game.addCollectible({code:11,x:ship.x,y:ship.y});
          }
        }
    }
};

let countDigits = function (num) {
  if (num === 0) return 1;
  return Math.floor(Math.log10(Math.abs(num))) + 1
}, toEngineering = function (num) { // 10573 --> 10.57K
  if (num < 1e3) return num;
  let TriIndex = Math.trunc((countDigits(num) - 1) / 3);
  return (num / 10**(TriIndex*3)).toFixed(2) + prefixes[TriIndex]
}, shields = [2500,2500,2500,3000,2500,2500,2500,2500,100000],
prefixes = ["", "K", "M", "B", "t", "q", "Q", "s", "S", "o", "n", "d", "U", "D", "T", "Qt", "Qd"]; // Up to 10^48

function shipshield(ship) {
  let shipshield = shields[(ship.type-790)-1];
  if (!isNaN(ship.shield) && ship.shield >= 1000) sendUI(ship, {
    id: "shieldBar",
    position: [3.3,10.5,17.4,3],
    visible: true,
    components: [
      {type:"box",position:[0,0,100,100],fill:"hsla(170, 32%, 28%, 1)",stroke:"hsla(170, 32%, 28%, 1)",width:2},
      {type:"box",position:[0,0,100*ship.shield/shipshield,100],fill:"hsla(192, 97%, 74%, 1)",stroke:"hsla(192, 97%, 74%, 1)",width:2},
      {type: "text",position:[80,0,20,100],value: toEngineering(ship.shield),color:"hsla(0, 0%, 0%, 1)"}
    ]
  });
  else sendUI(ship, {id:"shieldBar",visible:false})
}

function shipgem(ship) {
  let gemCap = gem_capacity;
  if (!ship.custom.gems) ship.custom.gems = 0;
  let totalGems = Math.min(ship.crystals + ship.custom.gems, gemCap);
  if (!isNaN(totalGems) && totalGems >= 1000) sendUI(ship, {
    id: "gemBar",
    position: [3.3,18.5,17.4,3],
    visible: true,
    components: [
      {type:"box",position:[0,0,100,100],fill:"hsla(13, 30%, 25%, 1)",stroke:"hsla(13, 30%, 25%, 1)",width:2},
      {type:"box",position:[0,0,100*totalGems/gemCap,100],fill:"hsla(5, 72%, 72%, 1)",stroke:"hsla(5, 72%, 72%, 1)",width:2},
      {type:"box",position:[0,90,100*ship.crystals/1000,10],fill:"hsla(5, 50%, 50%, 1)",stroke:"hsla(5, 50%, 50%, 1)",width:2},
      {type: "text",position:[80,0,20,100],value: toEngineering(totalGems),color:"hsla(0, 0%, 0%, 1)"}
    ]
  });
  else sendUI(ship, {id:"gemBar",visible:false})

  if (ship.crystals < 1000) {
    let moved = Math.min(ship.custom.gem? 99999 : ship.custom.gems, 1000 - ship.crystals);
    if (moved > 0){
      if (!ship.custom.gem) ship.custom.gems -= moved;
      ship.set({crystals: ship.crystals + moved});
    }
  } else if (ship.crystals > 1000) {
    ship.custom.gems += ship.crystals - 1000;
    ship.set({crystals: 1000});
  }
  if (ship.custom.gems > gemCap - 1000) ship.custom.gems = gemCap - 1000;
}

this.event = function(event,game) {
  var ship = event.ship;
  if (ship != null) switch (event.name){
    case "ui_component_clicked":
      var component = event.id;
      if (component.includes("ability") && ship.alive) {
        a = component.replace('ability','');
        ability.abilityeffect(ship,a);
      }
  }
};